import React from 'react';
import OnepageMenu from '../components/OnepageMenu';
import ServicesBanner from '../components/Banner/ServicesBanner';


const HomeCloud = () => {
    return(
        <div className="body_wrapper">


                <ServicesBanner 
                    ClassC='service_2' 
                    Title='Web and Mobile Application' 
                    TitleN='Services' 
                    TitleP='We create superior applications that digitally transform any platform.'
                    Simage='slider-web-app.png'/>
        </div>
    )
}
export default HomeCloud;
